import React from 'react'

const RouteComponent = () => {
    return <div>This is test component for route</div>
}

const routes = [
    {
		path: "#",
		title: "MyTitle",
		component: RouteComponent,
		accessible: true,
		exact: true,
    },
    {
        rootPath: '/mynestedroutes',
		path: "#",
		title: "Nested Routes",
		icon: <i className="ui terminal icon"></i>,
		component: RouteComponent,
		accessible: true,
		exact: true,
		routes: [
			{
				path: '/nestedrouteone',
				exact: true,
				accessible: true,
				component: RouteComponent,
			},
			{
				path: '/nestedroutetwo',
				exact: true,
				accessible: true,
				component: RouteComponent,
			},
			{
				path: '/nestedroutethree',
				title: "Title if visible child route",
				exact: true,
				accessible: true,
				component: RouteComponent,
            },
        ]
    }
]

export { routes }
